package com.amandris.clients.web.view;import java.util.ArrayList;import org.apache.struts.action.ActionForm;public class ContactDataView extends ActionForm{	private String 		newInvitations;	private String 		waitingContacts;	private String 		waitingDates;	private String 		waitingPayments;	private String 		waitingVotes;	private String 		totalContacts;	private ArrayList 	contacts; 		private static final long serialVersionUID = 1526471155622776000L;		public ContactDataView()	{		newInvitations			= "";		waitingContacts			= "";		waitingDates			= "";		waitingPayments			= "";		waitingVotes			= "";		totalContacts			= "";		contacts 				= new ArrayList();	}	public ArrayList getContacts() {		return contacts;	}	public void setContacts(ArrayList contacts) {		this.contacts = contacts;	}	public String getNewInvitations() {		return newInvitations;	}	public void setNewInvitations(String newInvitations) {		this.newInvitations = newInvitations;	}	public String getTotalContacts() {		return totalContacts;	}	public void setTotalContacts(String totalContacts) {		this.totalContacts = totalContacts;	}	public String getWaitingContacts() {		return waitingContacts;	}	public void setWaitingContacts(String waitingContacts) {		this.waitingContacts = waitingContacts;	}	public String getWaitingDates() {		return waitingDates;	}	public void setWaitingDates(String waitingDates) {		this.waitingDates = waitingDates;	}	public String getWaitingPayments() {		return waitingPayments;	}	public void setWaitingPayments(String waitingPayments) {		this.waitingPayments = waitingPayments;	}	public String getWaitingVotes() {		return waitingVotes;	}	public void setWaitingVotes(String waitingVotes) {		this.waitingVotes = waitingVotes;	}					}